  return (
    <div>
      <Header/>
      <Cover/>

      <div className='bg-rd px-6 py-4 text-gray-400'>

        <div className='border border-rb p-2 rounded-md'>
          <div className='rounded-full bg-gray-700 overflow-hidden w-10 h-10'>
            <img src={Avatar}/>
          </div>
          <form action='' className='flex-grow'>
            <input type="text" className='bg-rd-brighter border  border-rb p-2 block w-full rounded-md ml-4' placeholder='New post'/>
          </form>

        </div>
      </div>



    </div>
  );
}

